import React, { useEffect, useState } from 'react'

export default function BatchUpdating() {
  const [name, setName] = useState();
  const [roles, setRoles] = useState<string[]>([]);
  const [roleList, setRoleList] = useState<string[]>([]);

  useEffect(() => {
    if(name) {
      setRoleList(Object.keys(roles).filter((k: string) => roles[k]))
    }
  }, [name, roles])

  const onLoadUser = () => {
    setName('Test User');
    setRoles({
      editor: true
    })
  }

  return (
    <div>
      <span>Name:</span>
      <span>Name:</span>
      <span>Name:</span>
    </div>
  )
}
